INSERT INTO `om_lineas_institucionales_lista` (`id_linea_institucional_lista`, `nombre_linea_institucional`, `descripcion`, `borrado`, `log_accion`, `log_usuario`, `log_timestamp`) VALUES
(1, 'Competitividad, Productividad e Innovación', 'Promueve el estudio y el desarrollo de competencias que permitan participar productivamente y con eficiencia en la comunidad laboral a partir de la resolución creativa de problemáticas con el fin de generar soluciones sobresalientes e innovadoras.', 0, 'edit', 'admin', '2020-01-21 06:01:32'),
(2, 'Educación para el Desarrollo, la Paz y la Felicidad', 'Problematiza la educación y sus aportes al desarrollo cultural, la paz y la felicidad en los habitantes de una comunidad específica, abarcando los temas de bienestar y satisfacción como motores principales del individuo.', 0, 'edit', 'admin', '2020-01-21 06:01:57'),
(3, 'Estudios Socioambientales', 'Enmarcada en el cuidado de la salud de las personas, principalmente la población trabajadora y la protección del medio ambiente, aborda la dimensión social relacionada con la seguridad y salud en el trabajo y la problemática ambiental promoviendo las estrategias y métodos apropiados para dar cobertura a los requerimientos de la sociedad en general y de las organizaciones en particular en este campo de investigación.', 0, 'edit', 'admin', '2020-01-21 06:01:13'),
(4, 'Diseño, estructuración e Ingeniería de Procesos', 'Desarrolla metodologías para la resolución de problemas en el ámbito de ingeniería para la mejora y creación de procesos en diversas industrias de acuerdo a sus necesidades.', 0, 'edit', 'admin', '2020-01-21 06:01:19'),
(5, 'Producción de conocimiento en entornos virtuales de aprendizaje', 'Utiliza los espacios virtuales, no sólo con fines de formación interna (institucional) y de extensión, sino como medio y como producto en sí mismo, para la generación y comunicación de nuevo conocimiento de forma transversal e interdisciplinar entre los saberes. ', 0, 'edit', 'admin', '2020-01-21 06:01:48');
